import Footer from "./Menu/Footer"
import Menu from "./Menu/Menu"

function CadastroDeProduto () {
  return(
    <div>
    <Menu/>
    <h1>Cadastro de produto</h1>
    <div>
       <button>Click aqui</button>
    </div>
    <Footer/>
    </div>
  )
}
export default CadastroDeProduto ;
